css:
atom-text-editor,
:host {
  background-color: #141f2e;
  color: #ffffff;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #282a2e;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #373b41;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #373b41;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #141f2e;
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #1b2b40;
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #9f9f9f;
}
atom-text-editor .invisible,
:host .invisible {
  color: #ffffff;
}
atom-text-editor .cursor,
:host .cursor {
  color: #ffffff;
}
atom-text-editor .selection,
:host .selection {
  color: #ffffff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #375780;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #9f9f9f;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
.comment {
  color: #50f050;
  font-style: italic;
}
.comment .markup.link {
  text-decoration: underline;
}
.keyword {
  color: #0099ff;
}
.keyword.operator {
  color: #ffffff;
}
.keyword.operator.logical {
  color: #0099ff;
}
.keyword.other.special-method {
  color: #81a2be;
}
.keyword.other.unit {
  color: #ffcc33;
}
.storage.type {
  color: #91ccff;
}
.storage.type.class,
.storage.type.function {
  color: #0099ff;
}
.storage.type.primitive {
  color: #91ccff;
}
.storage.type.annotation {
  color: #ffcc33;
}
.storage.modifier {
  color: #0099ff;
}
.storage.modifier.import,
.storage.modifier.package {
  color: #ffffff;
}
.annotation .constant {
  color: #f7ff66;
}
.constant {
  color: #ffcc33;
}
.constant.character.escape {
  color: #8abeb7;
}
.constant.numeric {
  color: #ff8080;
}
.constant.other.color {
  color: #8abeb7;
}
.constant.other.symbol {
  color: #b5bd68;
}
.variable {
  color: #ffffff;
}
.variable.parameter {
  color: #f7ff66 !important;
}
.meta.class.body {
  color: #fffab1;
}
.meta.method-call .method,
.meta.method-call .punctuation {
  color: #ffffff;
}
.invalid.illegal {
  background-color: #cc6666;
  color: #141f2e;
}
.string {
  color: #a0ffa0;
}
.string.regexp {
  color: #8abeb7;
}
.string.other.link {
  color: #cc6666;
}
.punctuation.definition.comment {
